import 'bootstrap/dist/css/bootstrap.min.css';



function App() {

  return <Routes>
  <Route path="/home" element={<Home />}/>
  <Route path="/dosageDog" element={<Dog />}/>
  <Route path="/dosageCat" element={<Cat />}/>
</Routes>


}

export default App;
